import React, { Component } from "react";
import "./card.css";
import TextWithTitle from "./text-with-title";

class Card extends Component {
  state = {
    textWithTitle: [
      {
        key: 1,
        title: "title 1",
        text: "text 1"
      },
      {
        key: 2,
        title: "title 2",
        text: "text 2"
      },
      {
        key: 3,
        title: "title 3",
        text: "text 3"
      }
    ]
  };
  render() {
    return (
      <div className="card">
        <div className="top-section">
          <div className="title">Patient Name</div>
          <div className="date">Date</div>
        </div>
        {}
      </div>
    );
  }
}

export default Card;
